import * as React from 'react';
import { experimentalStyled as styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import { CardActionArea } from '@mui/material';
import Typography from '@mui/material/Typography';
const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

export default function Admin() {
const [userdatas,setUserDatas] = React.useState([])
    React.useEffect(()=>{
let userDetails = localStorage.getItem("userDetails")
let data = JSON.parse(userDetails)
setUserDatas(data)
    },[])
    return (
        <Box sx={{ flexGrow: 1 }} mt={5}>
            <Grid container spacing={{ xs: 0 }} columns={{ xs: 4, sm: 8, md: 12 }}>
                {userdatas.map((data, index) => (
                    <Grid item xs={0} sm={4} md={4} key={index}>
                        <Item>
                            <Card sx={{ maxWidth: 345 }}>
                                <CardActionArea>
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="div">
                                            {data.name}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Category : {data.category}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Score : {50}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Percentage : {20}
                                        </Typography>
                                        <Typography sx={{color:"blue"}} textAlign={"left"} variant="body2" color="text.secondary">
                                           Click to view answers
                                        </Typography>
                                    </CardContent>
                                </CardActionArea>
                            </Card>
                        </Item>
                    </Grid>
                ))}
            </Grid>
        </Box>
    );
}
